The music video for &quot;Teenage Dream&quot; was filmed in Santa Barbara in July 2010, and was directed by Yoann Lemoine.Perry planned the concept along with the songwriters during the sessions. Pictures from the shoot feature Perry kneeling in the sand looking at a man (played by Josh Kloss) wearing speedos, while others show her kissing the man in a hotel pool. She commented about the filming on her Twitter, saying, &quot;That's a wrap for Teenage Dream! So gorgeous In my hometown. I got to cast all my friends in the new music vid for Teenage Dream = amazing insanity.&quot; Perry was interviewed online viawhere she talked about the music video. She said,

&quot;It is gonna be completely different from 'California Gurls.' With 'Teenage Dream' you'll see a very raw, almost vulnerable `side] ... I had to wear so many less layers of makeup. I had to make out with a boy which was very traumatizing, I was kind of mean to him. I would be the one to call cut because I was like, 'oh I cant do this!' I feel so horrible. But I know it's a job. [Russell and me] understand what our work is.&quot;

A lyric video with pictures was uploaded to Perry'saccount on July 26, 2010. A 30-second snippet was released on August 5, 2010. The clip showed Perry in a montage through locations of Santa Barbara, including riding a late 1960s white BMW BMW New Class convertible, kissing her love interest and dancing on the beach with her friends. James Dinh of MTV said the teaser resonated with the song's feel-good melody. The video premiered on MTV on August 10, 2010 at 8:00pm ET. Its UK premiere was at 10:45pm on ITV2.
